import React from "react";
import Header from "../components/Header";

const Interest = () => {
  return (
    <>
      <div class="container-fluid p-0">
        <Header />
        <section class="resume-section" id="interests">
          <div class="resume-section-content">
            <h2 class="mb-5">Interests</h2>
            <p>

              I spend a large amount of my free time exploring the latest technology
              advancements in the front-end web development world
              Apart from being a web developer, I enjoy most of my time being
              at Gym.  During the warmer months here , I enjoy
              traveling through bike a lot 
            </p>
            <p class="mb-0">
              When forced indoors, I follow a number of sci-fi and fantasy genre
              movies and television shows, I enjoy play football , swimming , cricket and basketball. I help to train people body physique 
            </p>
          </div>
        </section>
        <hr class="m-0" />
      </div>
    </>
  );
};

export default Interest;
